import { useState } from "react";
import "./App.css";

function App() {
  const Login = () => {
    const [value, setValue] = useState("");
    const handleChange = (event) => {
      return setValue(event.target.value);
    };
    return (
      <div>
        <input type="text" value={value} onChange={handleChange} />
      </div>
    );
  };
  return (
    <div className="App">
      <Login />
    </div>
  );
}

export default App;
